# Yaşları kategorilendirme
def categorize_age(age_year):
  if 0 < age_year <= 2:
    return "Bebek"
  elif 2 < age_year <= 12:
    return "Çocuk"
  elif 12 < age_year <= 19:
    return "Ergen"
  elif 19 < age_year <= 24:
    return "Genç"
  elif 24 < age_year <= 44:
    return "Yetişkin"
  elif 44 < age_year <= 65:
    return "Orta Yaşlı"
  elif 65 < age_year:
    return "Yaşlı"

df['age_cat'] = df['age_year'].apply(lambda x: categorize_age(x))

